    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.nn               The TIGER/Line shapefiles include both incorporated places
    (legal entities) and census designated places or CDPs (statistical entities).  An
    incorporatedn               place is established to provide governmental functions
    for a concentration of people as opposed to a minor civil division (MCD), which
    generally isn               created to provide services or administer an area without
    regard, necessarily, to population.  Places always nest within a state, but may
    extend acrossn               county and county subdivision boundaries.  An incorporated
    place usually is a city, town, village, or borough, but can have other legal descriptions.n
                  CDPs are delineated for the decennial census as the statistical counterparts
    of incorporated places.  CDPs are delineated to provide data for settledn               concentrations
    of population that are identifiable by name, but are not legally incorporated under
    the laws of the state in which they are located.  Then               boundaries
    for CDPs often are defined in partnership with state, local, and/or tribal officials
    and usually coincide with visible features or then               boundary of an
    adjacent incorporated place or another legal entity.  CDP boundaries often change
    from one decennial census to the next with changes inn               the settlement
    pattern and development; a CDP with the same name as in an earlier census does not
    necessarily have the same boundary.  The onlyn               population/housing
    size requirement for CDPs is that they must contain some housing and population.
     nn               The boundaries of most incorporated places in this shapefile
    are as of January 1, 2013, as reported through the Census Bureau's Boundary and
    Annexationn               Survey (BAS).  Limited updates that occurred after January
    1, 2013, such as newly incorporated places, are also included.  The boundaries of
    all CDPsn               were delineated as part of the Census Bureau's Participant
    Statistical Areas Program (PSAP) for the 2010 Census.",nt"license_title": null,nt"extras":
